void obj_sprite_init(u16 free_tile_loc) {
    start_vram_addr = free_tile_loc;
    sprite_tile_buf = MEM_alloc(sizeof(tile)*64);

    
    available_sprites = VDP_getAvailableSprites();
    prev_sprite_idx = 79 - available_sprites;
    start_sprite_idx = VDP_allocateSprites(available_sprites);
    KLog_S2("prev sprite idx: ", prev_sprite_idx, " start sprite idX: ", start_sprite_idx);
}

void render_object_to_tile_column(u32 tex_per_pix, u32* tex_per_pix_table_ptr, s16 start_y, u16 min_y, u16 max_y, const column* col, u16* tile_buf_ptr) {
    // just render to the first tile
    // :^)
    if(col->num_spans == 0) { return; }

    u32 cur_pixel_16_16 = 0;

    const u8* spn_ptr = (const u8*)col->spans;

    const u16* texel_ptr = (const u16*)col->texels;

    u16 num_spans = col->num_spans;

    //u16 texel_lookup_base_offset = (scaled_pixels-1)<<5;
    //u32 tex_per_pix = scaled_sprite_run_lengths[texel_lookup_base_offset];

    u32 cur_tex_offset = 0;

    //KLog_U1("num spans: ", num_spans);

    for(int i = 0; i < num_spans; i++) {
        u8 skip = *spn_ptr++;
        u8 length = *spn_ptr++;

        u32 span_skip_16_16 = tex_per_pix_table_ptr[skip];
        u32 span_len_16_16 = tex_per_pix_table_ptr[length];

        u16 scaled_len = span_len_16_16>>16;
        //KLog_U3("unscaled skip: ", skip, " scaled skip: ", span_skip_16_16, " shifted skip: ", span_skip_16_16>>16);
        //KLog_U3("unscaled len: ", length, " scaled len: ", span_len_16_16, " shifted len: ", span_len_16_16>>16);
        //u16 scaled_skip = span_skip_16_16>>16;
        u32 prev_pixel_16_16 = cur_pixel_16_16;
        cur_pixel_16_16 += span_skip_16_16;
        u32 diff = cur_pixel_16_16 - prev_pixel_16_16;
        //KLog_U2("cur pixel 16.16: ", cur_pixel_16_16, " cur pixel int: ", cur_pixel_16_16>>16);

        u16* tile_ptr = &tile_buf_ptr[(cur_pixel_16_16>>16)<<1];
        //KLog_U2("cur y pos: ", (cur_pixel_16_16>>16), " tile offset: ", (cur_pixel_16_16>>16)<<1);
        //tile_buf_ptr = &tile_buf_ptr[(diff>>16)<<1];
        // advance to next span
        cur_pixel_16_16 += span_len_16_16;

        
        // draw span 

        for(u16 i = 0; i < scaled_len; i++) {
            //KLog_U2("cur_tex_offset: ", cur_tex_offset, "cur_tex_offset int: ", cur_tex_offset>>16);
            *tile_ptr++ = texel_ptr[cur_tex_offset>>16];
            tile_ptr++;
            cur_tex_offset += tex_per_pix;
        }
        
        
        //dra
        //draw_texture_vertical_line(pixel, pixel, pixel_end, tile_buf->bytes, texel_ptr);


    }
}

u16 render_object_to_sprite(s16 left_x,s16 top_y, u16 scaled_size, const rle_object* obj) {
    //return;

    u16 texel_lookup_base_offset = scaled_size<<6;
    u32 *tex_per_pix_table_ptr = scaled_sprite_texel_per_pixel_lut + texel_lookup_base_offset;
    u32 tex_per_pix = tex_per_pix_table_ptr[1];
    //u32
    
    //u32 col_per_pix = (obj->num_columns<<16)/scaled_size;
    //render_object_to_tile_column(tex_per_pix, tex_per_pix_table_ptr, top_y, 0, 143, obj->columns, tile_buf);



    u32 col_16_16 = 0;
    u16* tile_buf_ptr = sprite_tile_buf->bytes;

    u16 words = scaled_size>>2;

    u32 col_per_word = (obj->num_columns<<16)/words;
    

    u16 scaled_size_tiles = words >> 1;

    u16 rem_col = words & 1;
    u16 tile_columns_left = scaled_size_tiles;
    //KLog_U1("col per word: ", col_per_word);
    //KLog_U1("drawing to N tile columns: ", scaled_size_tiles);
    //if(scaled_size & 1) {
    //
    //}

    // this is slow..
    // i wonder if we can precalculate what tiles need to be cleared or filled per-sprite-and-size
    memset(sprite_tile_buf, 0, sizeof(tile)*scaled_size_tiles*scaled_size_tiles);

    u16 tile_skip_size = scaled_size_tiles * 16; // 16 words per tile
    //KLog_U1("skip after tile: ", tile_skip_size);
    while(tile_columns_left--) {
        u16 col = col_16_16>>16;
        //KLog_U1("drawing column: ", col);
        render_object_to_tile_column(tex_per_pix, tex_per_pix_table_ptr, top_y, 0, 143, &obj->columns[col], tile_buf_ptr);
        col_16_16 += col_per_word;
        
        col = col_16_16>>16;
        //KLog_U1("drawing column: ", col);
        render_object_to_tile_column(tex_per_pix, tex_per_pix_table_ptr, top_y, 0, 143, &obj->columns[col], tile_buf_ptr+1);
        col_16_16 += col_per_word;
        
        tile_buf_ptr += tile_skip_size;
    }

    if(rem_col) {
        u16 col = col_16_16>>16;
        render_object_to_tile_column(tex_per_pix, tex_per_pix_table_ptr, top_y, 0, 143, &obj->columns[col], tile_buf_ptr);
    }

    //KLog_U1("rendered sprite to N columns: " , tile_columns);
    VDP_loadTileData(sprite_tile_buf->rows, start_vram_addr, scaled_size_tiles*scaled_size_tiles, CPU);
    //u16 avail_spr = VDP_getAvailableSprites();
    //u16 start_spr = 79-avail_spr;
    //VDP_linkSprites()
    
    if(scaled_size_tiles*2 > available_sprites) {
        //KLog("too many sprites!");
        //return;
    }
    for(u16 i = 0; i < scaled_size_tiles; i++) {
        u16 sprite_idx = start_sprite_idx+(i*2);
        //KLog_U1("sprite_idx: ", sprite_idx);
        u16 tile_index = (start_vram_addr+(scaled_size_tiles*i));
        //KLog_U1("tile_index: ", tile_index);
        u16 x_pos = 32+(scaled_size_tiles*i);
        //KLog_U1("x_pos: ", x_pos);
        u16 y_pos = 32;

        VDP_setSpriteFull(
            sprite_idx,
            x_pos, y_pos, 
            SPRITE_SIZE(1,4),
            TILE_ATTR_FULL(PAL3, 1, 0, 0, tile_index),
            0);
        VDP_setSpriteFull(
            sprite_idx+1,
            x_pos, y_pos+(32), 
            SPRITE_SIZE(1,4),
            TILE_ATTR_FULL(PAL3, 1, 0, 0, tile_index+4),
            0);
    }
    
    VDP_linkSprites(prev_sprite_idx, scaled_size_tiles*2);
    VDP_updateSprites(start_sprite_idx+scaled_size_tiles*2, CPU);

    return scaled_size_tiles;

}

